  props: ['value'],
  created(){
    this.inputV = this.value
  },
  directives: { Clickoutside },
  methods: {
    updateValue(value) {
      this.$emit('input', value)
    },
    handleTabClick(tab, event) {
      this.cityVisible = true
      this.cityDist = null
    },
    getList(code) {
      let list = [], initials = []
      if(code == 'hot'){
         initials = [code]         
      }else{
        initials = code.split('')
      }
      initials.forEach(ele => {
        let selectCitys = this.citys.filter(el => {
          return (el.hot&&code=='hot')||el.initial == ele
        })
        if(!selectCitys.length) {
          return true
        }
        list.push({'name':code=='hot'?'常用':ele, 'list':selectCitys})
      })        
      return list
    },
    handleFocus() {
      this.pickerVisible = true
    },
    handleClose() {
      if (!this.pickerVisible) return
      this.pickerVisible = false
    },
    handleCityClick(e) {
      this.cityVisible = false
     // const {code, province, name} = e.target.dataset,//IE 11+
      const el = e.target, code = el.getAttribute('data-code'), province = el.getAttribute('data-province'), name = el.getAttribute('data-name')
      let selectCity = this.citys.filter(ele => {
        return (ele.code == code) && !ele.hot
      })
      this.cityDist = null
      if(selectCity.length) {
        this.cityDist = selectCity[0]
      }
    },
    showDist(tabName) {
      return tabName == this.activeTabName
    },
    showCity() {
      this.cityVisible = true
    },
    handleDistClick(e) {
      //const {code, province, city, area} = e.target.dataset //IE 11+
      const el = e.target, code = el.getAttribute('data-code'), province = el.getAttribute('data-province'), city = el.getAttribute('data-city'), area = el.getAttribute('data-area')
      //拼接省市区
      this.inputV = `${province}/${city}/${area}`
      this.updateValue(this.inputV)
      this.pickerVisible = false
      this.cityVisible = true      
    }
  }
}
